import React from 'react'

const CampaignThumbnails = (props) => {
    return (
        <div className='CampaignThumbnail'>
            <h3>{props.name}</h3>
            <ul>
                <li>View Campaign</li>
                <li>Delete Campaign</li>
            </ul>
        </div>
    )
}

export default CampaignThumbnails;
